public class InnerDataSourceConfluenceDataSourceConfigurationFactory(Action<Humidifier.Bedrock.DataSourceTypes.ConfluenceDataSourceConfiguration> factoryAction = null) : SubResourceFactory<Humidifier.Bedrock.DataSourceTypes.ConfluenceDataSourceConfiguration>
{

    internal InnerDataSourceConfluenceSourceConfigurationFactory SourceConfigurationFactory { get; set; }

    internal InnerDataSourceConfluenceCrawlerConfigurationFactory CrawlerConfigurationFactory { get; set; }

    protected override Humidifier.Bedrock.DataSourceTypes.ConfluenceDataSourceConfiguration Create()
    {
        var confluenceDataSourceConfigurationResult = CreateConfluenceDataSourceConfiguration();
        factoryAction?.Invoke(confluenceDataSourceConfigurationResult);

        return confluenceDataSourceConfigurationResult;
    }

    private Humidifier.Bedrock.DataSourceTypes.ConfluenceDataSourceConfiguration CreateConfluenceDataSourceConfiguration()
    {
        var confluenceDataSourceConfigurationResult = new Humidifier.Bedrock.DataSourceTypes.ConfluenceDataSourceConfiguration();

        return confluenceDataSourceConfigurationResult;
    }
    public override void CreateChildren(Humidifier.Bedrock.DataSourceTypes.ConfluenceDataSourceConfiguration result)
    {
        base.CreateChildren(result);

        result.SourceConfiguration ??= SourceConfigurationFactory?.Build();
        result.CrawlerConfiguration ??= CrawlerConfigurationFactory?.Build();
    }

} // End Of Class

